@sientifiko1 Si lo van a hacer de verdad, que el código quepa en un tweet.😉  #Rstats 
mean(vapply(1:10^7, FUN.VALUE = 1, FUN = function(x) {
sum &lt;- 0; i &lt;- 1
while(TRUE) {
  sum &lt;- sum + runif(1)
  if(sum &gt; 1) return(i) else {
    i &lt;- i+1
    next}
}}))

[1] 2.71824

@sientifiko1 Ahora la versión corta en #Rstats:

mean(replicate(10^7, min(which(cumsum(runif(100)) &gt; 1, TRUE))))

para sacarles pica, con medio tweet disponible. 😂

